INSERT INTO `comments` (`id`, `doctorId`, `timeBooking`, `dateBooking`, `name`, `phone`, `content`, `status`, `createdAt`, `updatedAt`, `deletedAt`) VALUES
(1, 26, '10:20 - 10:35', '2025-04-16', 'Võ Hồng Tiên', '0934978913', 'Tôi cảm thấy nhẹ nhàng hơn sau khi được bác sĩ tư vấn và điều trị cho vấn đề đau bụng.', 1, '2024-04-16 23:04:01', '2024-04-16 23:04:01', '0000-00-00 00:00:00'),
(2, 4, '10:40 - 10:55', '2025-04-16', 'Nguyễn Thị Hương Giang', '0934456123', 'Khám sức khỏe định kỳ thật sự quan trọng. Cảm ơn bác sĩ đã phát hiện sớm vấn đề về huyết áp của tôi.', 1, '2024-04-16 23:04:01', '2024-04-16 23:04:01', '0000-00-00 00:00:00'),
(3, 4, '15:40 - 16:10', '2025-04-16', 'Nguyễn Thị Ngân Anh', '0945288715', 'Sự chăm sóc tận tình và am hiểu từ đội ngũ y tế đã giúp tôi vượt qua nỗi lo lắng về triệu chứng ho kéo dài.', 1, '2024-04-16 23:04:01', '2024-04-16 23:04:01', '0000-00-00 00:00:00'),
(4, 5, '9:00 - 9:15', '2025-04-05', 'Lê Đình', '0981234567', 'Tôi rất hài lòng với kết quả xét nghiệm và lời khuyên dinh dưỡng từ bác sĩ. Sức khỏe của tôi đang được cải thiện từng ngày.', 1, '2024-04-16 23:04:01', '2024-04-16 23:04:01', '0000-00-00 00:00:00'),
(5, 5, '9:20 - 9:50', '2025-04-07', 'Nguyễn Thị D', '0654321098', 'Tôi cảm thấy an tâm hơn sau khi được giải đáp mọi thắc mắc về vấn đề tiểu đường của mình.', 1, '2024-04-16 23:04:01', '2024-04-16 23:04:01', '0000-00-00 00:00:00'),
(6, 6, '13:30 - 14:00', '2025-04-11', 'Lê Nhật Minh', '0987654321', 'Mọi thứ đều rất suôn sẻ từ việc đặt lịch hẹn đến quá trình khám và điều trị. Tôi hoàn toàn tin tưởng vào chất lượng dịch vụ y tế ở đây.', 1, '2024-04-16 23:04:01', '2024-04-16 23:04:01', '0000-00-00 00:00:00'),
(7, 6, '14:10 - 14:40', '2025-04-11', 'Phan Trần Đức', '0567890123', 'Bác sĩ đã rất tỉ mỉ trong quá trình khám và giải thích rõ ràng về kết quả xét nghiệm. Tôi rất biết ơn điều đó.', 1, '2024-04-16 23:04:01', '2024-04-16 23:04:01', '0000-00-00 00:00:00'),
(8, 8, '9:40 - 10:10', '2025-04-11', 'Bùi Văn Hà', '0456789012', 'Sau khi điều trị, tôi thấy mình có nhiều năng lượng hơn và giảm được mệt mỏi do vấn đề tiêu hóa.', 1, '2024-04-16 23:04:01', '2024-04-16 23:04:01', '0000-00-00 00:00:00'),
(9, 8, '8:40 - 9:10', '2025-04-11', 'Trần Trí Nam', '0765432109', 'Tôi đã học được nhiều về cách chăm sóc sức khỏe cá nhân và phòng tránh bệnh tật từ cuộc hẹn khám sức khỏe này.', 1, '2024-04-16 23:04:01', '2024-04-16 23:04:01', '0000-00-00 00:00:00'),
(10, 13, '9:20 - 9:50', '2025-04-11', 'Vũ Thị Thu Thảo', '0765432109', 'Bác sĩ đã đặt ra kế hoạch điều trị chi tiết và dễ hiểu, giúp tôi tự tin hơn trong quá trình kháng chiến với bệnh tật.', 1, '2024-04-16 23:04:01', '2024-04-16 23:04:01', '0000-00-00 00:00:00'),
(11, 13, '9:20 - 9:35', '2025-04-17', 'Vũ Thị Thu Thảo', '0654321098', 'Tôi vẫn chưa thấy kết quả', 1, '2024-06-10 23:49:53', '2024-06-10 23:49:53', '0000-00-00 00:00:00'),
(12, 1, '14:40 - 15:10', '2025-04-20', 'Pham Thanh Bình', '0382106557', 'Cảm ơn ban. Tôi đã khỏi bệnh', 1, '2025-04-17 12:42:57', '2025-04-17 12:42:57', '0000-00-00 00:00:00'),
(13, 1, '8:40 - 9:10', '2025-05-21', 'Nguyễn Thịnh', '0585825125', 'Bác Sĩ thân thiện, Tư vấn dễ hiểu', 1, '2025-05-21 14:08:52', '2025-05-21 14:08:52', '0000-00-00 00:00:00');
